import React, { useState } from 'react';
import { Link, NavLink } from 'react-router-dom';

import menu from './../data/menu';

function ListMenu({ path, name, children= null, onClick= null }) {
	return (
		<li>
			{
				!children ? (<Link to={path}>{name}</Link>) : (<Link to={path} onClick={onClick}><span>{name}</span><i className="bi bi-chevron-down"></i>{children}</Link>)
			}
		</li>
	)
}

function Navbar() {
	const [toggle, setToggle] = useState(false);
  const handleToggle = () => setToggle(!toggle);
  const [dropdown, setDropdown] = useState(false);
	const handleDropdown = () => setDropdown(!dropdown);

	return (
		<nav id="navbar" className={!toggle ? "navbar" : "navbar navbar-mobile"}>
			<ul>
				<ListMenu name="Home" pat="/home" />
				<ListMenu name="About" pat="/#" onClick={handleDropdown}>
					<ListMenu name="About Us" path="/about" />
					<ListMenu name="Our Team" path="/team" />
					<ListMenu name="Other" path="/#" onClick={handleDropdown}>
						<ListMenu name="Link 1" path="/link-1" />
						<ListMenu name="Link 2" path="/link-2" />
						<ListMenu name="Link 3" path="/link-3" />
					</ListMenu>
				</ListMenu>
				<ListMenu name="Contact" pat="/contact" />
			</ul>

			{ !toggle ?
 				(<i onClick={handleToggle} className="bi mobile-nav-toggle bi-list"></i>)
				:
				(<i onClick={handleToggle} className="bi mobile-nav-toggle bi-x"></i>)
			}
		</nav>
	)
}

function Header() {
	return (
  	<header id="header" className="fixed-top d-flex align-items-center">
			<div className="container d-flex align-items-center justify-content-between">
				<div className="logo">
					<h1 className="text-light">
						<NavLink
							to="/"
							className={({ isActive, isPending }) =>
    isPending ? "pending" : isActive ? "active" : ""
  }
						>Serenity</NavLink>
					</h1>
					{/*<Link to="/">
						<img src="../assets/img/logo.png" alt="" className="img-fluid" />
					</Link>*/}
				</div>
				<Navbar />
			</div>
		</header>
	)
}

export default Header;

